def leaky_relu(x):
    x[x<0]*=0.01
    return x
def fc(input, weight, bias):
    return np.matmul(weight, input )+bias

class RevNet2:
    def predict(self, board):
        v = board.reshape(64,1)
        score0 = leaky_relu(fc(v * leaky_relu(fc(v, WEIGHT1, WEIGHT1_BIAS)), FC0_WEIGHT, FC0_BIAS) )
        score1 = leaky_relu(fc(v * leaky_relu(fc(v, WEIGHT2, WEIGHT2_BIAS)), FC1_WEIGHT, FC1_BIAS) )
        score2 = leaky_relu(fc(v, FC2_WEIGHT, FC2_BIAS))
        s = np.concatenate((score0, score1, score2))
        return np.tanh(fc(s, SCORE_WEIGHT, SCORE_BIAS))[0]

def place(board, x, y, color):
        if x < 0:
            return True
        board[x][y] = color
        valid = False
        for d in range(8):
            i = x + DIR[d][0]
            j = y + DIR[d][1]
            while 0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == -color:
                i += DIR[d][0]
                j += DIR[d][1]
            if 0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == color:
                while True:
                    i -= DIR[d][0]
                    j -= DIR[d][1]
                    if i == x and j == y:
                        break
                    valid = True
                    board[i][j] = color
        return valid
def test_place(board, x, y, color):
    for d in range(8):
        i = x + DIR[d][0]
        j = y + DIR[d][1]
        while 0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == -color:
            i += DIR[d][0]
            j += DIR[d][1]
        if  0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == color:
            i -= DIR[d][0]
            j -= DIR[d][1]
            if not(i == x and j == y):
                return True
    return False

def find_move(board, color):
    moves = []
    for i in range(8):
        for j in range(8):
            if board[i][j] == 0:
                if test_place(board, i, j, color):
                    moves.append((i, j))
    return moves

def game_ended(board):
    if find_move(board, 1) or find_move(board,-1):
        return 0
    else:
        if board.sum()==0:
            return 0.1
        return board.sum() 

def house_keeping(Qsa, Nsa, Ns, Es, Vs, turn):
    try:
        for s in list(Vs.keys()):
            if np.count_nonzero(np.fromstring(s,dtype=np.int))<turn:
                del Vs[s]
                del Ns[s]
                del Es[s]
        for s,a in list(Nsa.keys()):
            if np.count_nonzero(np.fromstring(s,dtype=np.int))<turn:
                del Nsa[(s,a)]
                del Qsa[(s,a)] 
    except KeyError:
        pass
    
#don't change the class name
class AI(object):
    #chessboard_size, color, time_out passed from agent
    def __init__(self, chessboard_size=8, color=-1, time_out=5.0, net=RevNet2(), noise=False, temp_threshold=0):
        self.chessboard_size = chessboard_size
        self.color = color
        self.time_out = time_out-0.25
        self.candidate_list = []
        self.count = 0
        self.nnet = net
        self.noise = noise
        self.cpuct = 1.1
        self.temp_threshold  = temp_threshold
        # acknowledge: inspired by https://web.stanford.edu/~surag/posts/alphazero.html
        # accomodated to our setting
        self.Qsa = {}  # stores Q values for s,a (as defined in the paper)
        self.Nsa = {}  # stores #times edge s,a was visited
        self.Ns = {}  # stores #times board s was visited
        self.Es = {}  # stores whether game is ended for board s
        self.Vs = {}  # stores valid moves for board s

# The input is current chessboard.
    def go(self, chessboard):
        # Clear candidate_list, must do this step
        self.repeated = 0
        self.state_searched = 0
        self.candidate_list.clear()
        self.candidate_list = find_move(chessboard, self.color)
        if self.candidate_list:
            start = perf_counter()
            turn = np.count_nonzero(chessboard)-3
            if turn>48:
                self.candidate_list.append(self.alpha_beta(chessboard))
            else:
                self.candidate_list.append(self.MCTS(chessboard*self.color, turn, self.noise))
                threading.Thread(target=house_keeping, args=(self.Qsa, self.Nsa, self.Ns, self.Es, self.Vs, turn)).start()
            print('player=%d time=%f turn=%d #sims=%d'%(self.color,perf_counter()-start,turn,self.count))
        
        
    def alpha_beta(self, board):
        def max_value(board, color):
            s= (board*color).tostring() 
            self.state_searched+=1
            if s in self.Vs:
                self.repeated+=1
            else:
                self.Vs[s] = find_move(board, color)
            moves = self.Vs[s]
            if not moves:
                if not find_move(board, -color):
                    return np.sum(board)*self.color # ?
                else: 
                    return min_value(board.copy(), -color)
            try:
                moves.sort(key=lambda move: self.Nsa[(s, move)], reverse=True)
            except KeyError:
                moves.sort(key=lambda move: WEIGHT50[move[0],move[1]], reverse=True)
            v = -INF
            for x, y in moves:
                next_board = board.copy()
                assert place(next_board, x, y, color)
                v = max(v, min_value(next_board, -color))
                if v>0:
                    return v
            return v
        def min_value(board, color):
            s= (board*color).tostring() 
            self.state_searched+=1
            if s in self.Vs:
                self.repeated+=1
            else:
                self.Vs[s] = find_move(board, color)
            moves = self.Vs[s]
            if not moves:
                if not find_move(board, -color):
                    return np.sum(board)*self.color
                else:
                    return max_value(board.copy(), -color)
            try:
                moves.sort(key=lambda move: self.Nsa[(s, move)], reverse=True)
            except KeyError:
                moves.sort(key=lambda move: WEIGHT50[move[0],move[1]], reverse=True)
            v = INF
            for x, y in moves:
                next_board = board.copy()
                assert place(next_board, x, y, color)
                v = min(v, max_value(next_board, -color))
                if v<0:
                    return v
            return v

        moves = find_move(board, self.color)
        s = (board*self.color).tostring()
        try:
            moves.sort(key=lambda move: self.Nsa[(s, move)], reverse=True)
        except KeyError:
            moves.sort(key=lambda move: WEIGHT50[move[0],move[1]], reverse=True)
        for x, y in moves:
            next_board = board.copy()
            assert place(next_board, x, y, self.color)
            v = min_value(next_board, -self.color)
            if v> 0:
                return(x ,y)
        return moves[0]
    

    def MCTS(self, canonicalBoard, turn, noise=False):
        start_time = perf_counter()
        # search until run out of time
        self.count = 0
        while perf_counter() - start_time < self.time_out:
            self._search(canonicalBoard.copy(), noise)
            self.count+=1
        s = canonicalBoard.tostring()
        
        moves = self.Vs[s]
        counts = np.array([self.Nsa[(s, a)] if (s, a) in self.Nsa else 0 for a in moves], dtype=np.float)
        if turn<self.temp_threshold:
            counts/=counts.sum()
            best_move = rng.choice(moves, p=counts)
        else:
            best_move = moves[np.argmax(counts)]
        return best_move

    def _search(self, canonicalBoard, noise=False):
        s = canonicalBoard.tostring()
        if s not in self.Es:
            self.Es[s] = game_ended(canonicalBoard)
        if self.Es[s] != 0:
            # terminal node
            return -self.Es[s]

        if s not in self.Ns:
            # leaf node
            v = self.nnet.predict(canonicalBoard)
            moves = find_move(canonicalBoard, 1)
            self.Vs[s] = moves
            self.Ns[s] = 0
            return -v
        
        moves = self.Vs[s]
        cur_best = -float('inf')
        best_act = (-1, -1)
        if moves: 
            l = len(moves)
            p = np.ones((l))/float(l)
            if noise: p = 0.75*p + 0.25*rng.dirichlet([.5]*l)
        else : l=0
        # pick the action with the highest upper confidence bound
        for a, i in zip(moves, range(l)):
            if (s, a) in self.Qsa:
                u = self.Qsa[(s, a)] + self.cpuct * p[i] * np.sqrt(self.Ns[s]) / (
                            1 + self.Nsa[(s, a)])
            else:
                u = self.cpuct * p[i] * np.sqrt(self.Ns[s] + 1e-8)  
            if u > cur_best:
                cur_best = u
                best_act = a

        next_board = canonicalBoard.copy()
        assert place(next_board, best_act[0], best_act[1], 1)
        v = self._search(-next_board)
        a = best_act
        if (s, a) in self.Qsa:
            self.Qsa[(s, a)] = (self.Nsa[(s, a)] * self.Qsa[(s, a)] + v) / (self.Nsa[(s, a)] + 1)
            self.Nsa[(s, a)] += 1
        else:
            self.Qsa[(s, a)] = v
            self.Nsa[(s, a)] = 1
    
        self.Ns[s] += 1
        return -v
            

    